import React from 'react'

export const About = () => {

    let myStyle = {
        minHeight: "100vh"
    }
    return (
        <div style={myStyle}>
        <>
           <h3 className="my-3 text-center">My Name Is Darpan Manek</h3>
           <hr />
           <p className="text-center"><b>This Is 'My TodoLIst App'.<br />You can set your daily todos and also delete todos.</b></p>
           <hr />
           <footer className=" my-3 text-center">Created By Manek Darpan <br />Contact : darpanmanekgrt@gmail.com</footer>
        </>   
        </div>
    )
}
